import Link from 'next/link';

const navStyle = {
	textAlign: 'right',
	position: 'relative',
	top: '-1.7em'
	// marginTop: '10%',

};
const linkStyle = {
	// margin: '75px',
	// textDecoration: 'none',
	// color: 'black'
};
const imgStyle = {
	height: '10%',
	textAlign: 'left',
	display: 'block',
	marginLeft: '10px',
	// marginRight: 'auto',
	width: '25%'
}
const appStyle = {
	textAlight: 'center' ,
	fontSize: '2em',
	fontFamily: '"Arial Black", Gadget, sans-serif',
	position: 'fixed',
	top: 0,
	width: '100%',
	zIndex: '999',
	backgroundColor: 'white'
}
openContactForm = () =>{
	window.open('')
}
const Header = () => (
	<div style={appStyle}>
		<img src="/dkp.png" style={imgStyle}/>
		<div style={navStyle}> 
			<Link href="/">
				<button class="navStyle">Home</button>
			</Link>
			<Link href="/about">
				<button style={linkStyle} class="navStyle">About</button>
			</Link>
			<Link href="/events">
				<button style={linkStyle} class="navStyle">Event Calendar</button>
			</Link>
			<Link href="/fotoxl">
				<button style={linkStyle} class="navStyle">FotoXL</button>
			</Link>
			<Link href="/solutions">
				<button style={linkStyle} class="navStyle">Business Solutions</button>
			</Link>
			<Link>
				<button style={linkStyle} class="navStyle" onClick={() => {openContactForm()}}>Contact Us</button>
			</Link>
		</div>
	</div>
);

export default Header;
